import './App.css';

function App() {
  const studentList = [
    {
      name: "Bob",
      id: 1
    },
    {
      name: "Albert",
      id: 2
    },
    {
      name: "Shania",
      id: 3
    },
    {
      name: "Erika",
      id: 4
    },
    {
      name: "Desmond",
      id: 5
    },
    {
      name: "Shai",
      id: 6
    },
  ]
  return (
    <div className="App">
      {studentList.map((s) => <p>{s.name}</p>)}
    </div>
  );
}

export default App;
